import CardListItem from "components/CardListItem/CardListItem";

function CardList({ links }) {
  return (
    <div className="card-container">
      <ul className="grid">
        {links?.map((link) => (
          <CardListItem key={link.id} link={link} />
        ))}
      </ul>
    </div>
  );
}

export default CardList;
